    staff_id character varying(255) NOT NULL,
    period_start date NOT NULL,
    period_end date NOT NULL,
    regular_hours numeric DEFAULT 0 NOT NULL,
    overtime_hours numeric DEFAULT 0 NOT NULL,
    weekend_hours numeric DEFAULT 0 NOT NULL,
    holiday_hours numeric DEFAULT 0 NOT NULL,
    total_mileage numeric DEFAULT 0 NOT NULL,
    base_compensation numeric DEFAULT 0 NOT NULL,
    overtime_compensation numeric DEFAULT 0 NOT NULL,
    weekend_compensation numeric DEFAULT 0 NOT NULL,
    holiday_compensation numeric DEFAULT 0 NOT NULL,
    mileage_reimbursement numeric DEFAULT 0 NOT NULL,
    adjustments numeric DEFAULT 0 NOT NULL,
    total_compensation numeric NOT NULL,
    status character varying(50) DEFAULT 'pending'::character varying NOT NULL,
    approved_by character varying(255),
    approved_at timestamp without time zone,
    paid_at timestamp without time zone,
    notes text,
    created_at timestamp without time zone DEFAULT CURRENT_TIMESTAMP NOT NULL,
    updated_at timestamp without time zone DEFAULT CURRENT_TIMESTAMP NOT NULL,
    pay_slip_generated boolean DEFAULT false,
    pay_slip_url text
);


ALTER TABLE public.staff_compensations OWNER TO neondb_owner;

--
-- Name: staff_rates; Type: TABLE; Schema: public; Owner: neondb_owner
--

CREATE TABLE public.staff_rates (
    id character varying(255) DEFAULT (gen_random_uuid())::text NOT NULL,
    staff_id character varying(255) NOT NULL,
    service_type_id character varying(255),
    weekday_rate character varying(50) DEFAULT '20.00'::character varying NOT NULL,
    weekend_rate character varying(50) DEFAULT '25.00'::character varying NOT NULL,
    holiday_rate character varying(50) DEFAULT '30.00'::character varying NOT NULL,
    overtime_multiplier character varying(50) DEFAULT '1.5'::character varying NOT NULL,
    mileage_rate_per_km character varying(50) DEFAULT '0.50'::character varying NOT NULL,
    effective_from date DEFAULT CURRENT_DATE NOT NULL,
    effective_to date,
    is_active boolean DEFAULT true NOT NULL,
    created_at timestamp without time zone DEFAULT CURRENT_TIMESTAMP NOT NULL,
    updated_at timestamp without time zone DEFAULT CURRENT_TIMESTAMP NOT NULL
);


ALTER TABLE public.staff_rates OWNER TO neondb_owner;

--
-- Name: time_logs; Type: TABLE; Schema: public; Owner: neondb_owner
--

CREATE TABLE public.time_logs (
    id character varying DEFAULT gen_random_uuid() NOT NULL,
    client_id character varying NOT NULL,
    staff_id character varying NOT NULL,
    service_date timestamp without time zone NOT NULL,
    hours numeric(4,2) NOT NULL,
    service_type character varying NOT NULL,
    hourly_rate numeric(10,2) NOT NULL,
    total_cost numeric(10,2) NOT NULL,
    notes text,
    created_at timestamp without time zone DEFAULT now(),
    updated_at timestamp without time zone DEFAULT now(),
    scheduled_start_time timestamp without time zone,
    scheduled_end_time timestamp without time zone,
    actual_start_time timestamp without time zone,
    actual_end_time timestamp without time zone,
    service_location text,
    mileage numeric(10,2),
    compensation_id character varying(255),
    excel_data_id character varying(255),
    external_identifier character varying,
    import_id character varying
);


ALTER TABLE public.time_logs OWNER TO neondb_owner;

--
-- Name: user_consents; Type: TABLE; Schema: public; Owner: neondb_owner
--

CREATE TABLE public.user_consents (
    id character varying DEFAULT gen_random_uuid() NOT NULL,
    user_id character varying NOT NULL,
    consent_type character varying NOT NULL,
    consent_given boolean NOT NULL,
    consent_date timestamp without time zone DEFAULT now() NOT NULL,
    ip_address character varying,
    user_agent text,
    privacy_policy_version character varying,
    revoked_date timestamp without time zone,
    created_at timestamp without time zone DEFAULT now(),
    updated_at timestamp without time zone DEFAULT now()
);


ALTER TABLE public.user_consents OWNER TO neondb_owner;

--
-- Name: users; Type: TABLE; Schema: public; Owner: neondb_owner
